    const onLogOut = useCallback(() => {}, []);

  return (
    <>
      <Card
        style={{ width: 300 }}
        cover={
          <img
            alt="example"
            src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
          />
        }
        actions={[
          <div key="twit">트윗<br/>0</div>,
          <div key="twit">팔로잉<br/>0</div>,
          <div key="twit">팔로워<br/>0</div>,
        ]}
      >
        <Meta
          avatar={
            <Avatar>동우</Avatar>
